// ResumeBuilderPage.js
import React, { useState } from "react";
import { Container, Form, Button, Alert } from "react-bootstrap";
import jsPDF from "jspdf";

function ResumeBuilderPage() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    education: "",
    experience: "",
    skills: "",
  });
  const [success, setSuccess] = useState("");

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const generatePDF = () => {
    const doc = new jsPDF();

    // Add content to the PDF
    doc.setFontSize(20);
    doc.text("Resume", 20, 20);
    doc.setFontSize(14);
    doc.text(`Name: ${formData.name}`, 20, 30);
    doc.text(`Email: ${formData.email}`, 20, 40);
    doc.text(`Phone: ${formData.phone}`, 20, 50);
    doc.text("Education:", 20, 60);
    doc.text(formData.education, 20, 70);
    doc.text("Experience:", 20, 90);
    doc.text(formData.experience, 20, 110);
    doc.text("Skills:", 20, 130);
    doc.text(formData.skills, 20, 150);

    // Save the PDF
    doc.save(`${formData.name}_Resume.pdf`);
    setSuccess("Your resume has been generated!");
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    generatePDF();
  };

  return (
    <Container className="mt-5">
      <h2>Create Your Resume</h2>
      {success && <Alert variant="success">{success}</Alert>}
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formName" className="mb-3">
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            placeholder="Enter your name"
            required
          />
        </Form.Group>

        <Form.Group controlId="formEmail" className="mb-3">
          <Form.Label>Email</Form.Label>
          <Form.Control
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            placeholder="Enter your email"
            required
          />
        </Form.Group>

        <Form.Group controlId="formPhone" className="mb-3">
          <Form.Label>Phone</Form.Label>
          <Form.Control
            type="text"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
            placeholder="Enter your phone number"
            required
          />
        </Form.Group>

        <Form.Group controlId="formEducation" className="mb-3">
          <Form.Label>Education</Form.Label>
          <Form.Control
            as="textarea"
            name="education"
            value={formData.education}
            onChange={handleChange}
            placeholder="Enter your education details"
            required
          />
        </Form.Group>

        <Form.Group controlId="formExperience" className="mb-3">
          <Form.Label>Experience</Form.Label>
          <Form.Control
            as="textarea"
            name="experience"
            value={formData.experience}
            onChange={handleChange}
            placeholder="Enter your work experience"
            required
          />
        </Form.Group>

        <Form.Group controlId="formSkills" className="mb-3">
          <Form.Label>Skills</Form.Label>
          <Form.Control
            as="textarea"
            name="skills"
            value={formData.skills}
            onChange={handleChange}
            placeholder="Enter your skills"
            required
          />
        </Form.Group>

        <Button variant="primary" type="submit">
          Generate Resume
        </Button>
      </Form>
    </Container>
  );
}

export default ResumeBuilderPage;
